import React from 'react';
import { 
    PortfolioItemContainer } from '../portfolio-item/portfolio-item.styles';

const PortfolioItem = (props) => {
    const { header, company, description, image, redirect } = props

    return (
        <PortfolioItemContainer>
			<div className="portfolio-description has-margin-right" data-aos="fade-right" data-aos-delay="300">
				<h6>{header}</h6>
				<h1>{company}</h1>
				<p>{description}</p>
				<a href={redirect} className="cta">View Details</a>
			</div>
			<div className="portfolio-img" data-aos="fade-left" data-aos-delay="600">
				<img src={image} alt=""/>
			</div>	
		</PortfolioItemContainer>
    )
}

export { PortfolioItem };
